import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <nav className="navbar">
      <h1 className="title__1">
        Covid19<span className="title__2">-meter</span>
      </h1>
      <img src="./covid-logo.png" alt="Covid" className="covid__logo" />
    </nav>
  );
}

export default Nav;
